Cast: Nikki Benz, Bonnie Rotten, Monique Alexander, Destiny Dixon, Romi Rain

Description: The dark, mysterious and deviously sexy Bonnie Rotten appears on an old country road to offer her service to three men broken down and stranded. Beguiled, the men follow the seductive vixen to her home where a huge all girl Halloween bash is underway. The guys think they are in for the night of their lives, little do they know something sinfully sexy and sinister is in store for them. These tantalizing women aren't what they appear to be. Also starring Nikki Benz, Monique Alexander, Romi Rain &amp; Destiny Dixon for a night of steaming hot sex with a chilling dark twist.

